.
A trilogia Super Butouden eram o início dos jogos de luta de Dragon Ball, que dividia a tela a medida que os personagens se distanciavam, sendo possível, ainda, voar e carregar o Ki, e, graças à pirataria era possível encontrar esses cartuchos em muitas locadoras pelo Brasil afora.
.
O segundo jogo dessa trilogia foi o que mais se destacou, melhorando muito as mecânicas e jogabilidade em relação ao primeiro e possuindo o melhor modo história dos três títulos (o terceiro deixou a desejar pois retiraram o modo história)
.
Baseado na Saga Cell, Super Butouden 2 possui como personagens jogáveis: Goku, Gohan, Vegeta, Trunks do futuro, Piccolo, Cell, Cell Jr., que aparecem no cânone da série, e Zangya, Bojack e Broly, estes três últimos aparecem em OVA's do anime, alguns personagens só são jogáveis após serem desbloqueados com um código que deve ser ativado assim que o jogo inicia (bons tempos em que não precisava pagar por isso😉)
.
O modo história chama a atenção por ser possível escolher caminhos diferentes, podendo o jogador escolher quem será seu próximo oponente e isso vai levando a outros rumos, que são mostrados através de diálogos e imagens, vale mencionar que cada personagem disponível no modo história possui um final diferente.
.
Se hoje em dia temos jogos praticamente perfeitos como FighterZ, naquela época a trilogia Super Butouden era o que fazia a alegria dos fãs de Goku e dos Guerreiros Z.
.
